      console.log(result);
      if (result.code == 200) {
        this.myOrder = result.data;
      }
    },
    // 获取当前点击的那一页
    getPageNo(page) {
      // 修改组件响应式数据page
      this.page = page;
      //请求数据
      this.getData();
    },
  },
};
